import React from 'react'



import './Project.scss';

export default function Project() {
    return (
        <div>
            {MyProject.map(item => <div>
                <h2>{item.title}</h2>
            </div>)}
        </div>
    )
}

const MyProject = [
    {
        title: 'Movies-ddf',
